var timerID=null;var interval=100;self.onmessage=function(a){if(a.data=="start"){timerID=setInterval(function(){postMessage("tick")},interval)}else{if(a.data.interval){interval=a.data.interval;if(timerID){clearInterval(timerID);timerID=setInterval(function(){postMessage("tick")},interval)}}else{if(a.data=="stop"){clearInterval(timerID);timerID=null}}}};